package generator

func convolve(wave, ir []float64) []float64 {
	result := make([]float64, len(wave))
	if len(wave) == 0 {
		return result
	}
	base := wave[0]
	for i := range wave {
		result[i] = base
		for j, r := range ir {
			if j <= i {
				result[i] += r * (wave[i-j] - base)
			}
		}
	}
	return result
}

